import React from "react";
import { MdOutlineEmail } from "react-icons/md";
function Contact() {
  return (
    <section id="contact">
      <h5>Get In Touch</h5>
      <h2>Contact</h2>
      <div className="container contact_container">
        <div className="contact_options">
          <article>
            <MdOutlineEmail />
            <h4>Email</h4>
            <h5>muhammadnomantariq1999@gmail.com</h5>
            <a href="mailto:muhammadnomantariq1999@gmail.com">Send a message</a>
          </article>
        </div>
        <form action=""></form>
      </div>
    </section>
  );
}

export default Contact;
